import logo from "./images/netflix-Logo.svg";
import React from 'react'
import HeaderCss from "./header.css";

function Header() {
  return (
    <>
      <nav>
        <img className = {HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
        <button>Sign In</button>
      </nav>
    </>
  );
}

export default Header;
